'use strict';

var _saved_object_loader = require('ui/courier/saved_object/saved_object_loader');

var _saved_object_registry = require('plugins/kibana/management/saved_object_registry');

var _modules = require('ui/modules');

require('./_saved_sheet.js');

var _module = _modules.uiModules.get('app/sheet');

// Register this service with the saved object registry so it can be
// edited by the object editor.
_saved_object_registry.savedObjectManagementRegistry.register({
  service: 'savedSheets',
  title: 'sheets'
});

// This is the only thing that gets injected into controllers
_module.service('savedSheets', function (Promise, SavedSheet, kbnIndex, kbnUrl, $http) {
  var savedSheetLoader = new _saved_object_loader.SavedObjectLoader(SavedSheet, kbnIndex, kbnUrl, $http);
  savedSheetLoader.urlFor = function (id) {
    return kbnUrl.eval('#/{{id}}', { id: id });
  };

  // Customize loader properties since adding an 's' on type doesn't work for type 'timelion-sheet'.
  savedSheetLoader.loaderProperties = {
    name: 'timelion-sheet',
    noun: 'Saved Sheets',
    nouns: 'saved sheets'
  };
  return savedSheetLoader;
});
